import React, { useState, useEffect } from 'react';
import './App.css';

const API_URL = 'http://localhost:3001';

const perfilPadrao = {
  imagem: '',
  nome: '',
  idade: '',
  rua: '',
  bairro: '',
  estado: '',
  biografia: ''
};

function App() {
  const [perfil, setPerfil] = useState(perfilPadrao);
  const [editando, setEditando] = useState(false);
  const [form, setForm] = useState(perfilPadrao);
  const [imagemPreview, setImagemPreview] = useState('');
  const [imagemArquivo, setImagemArquivo] = useState(null);
  const [carregando, setCarregando] = useState(true);

  // Buscar dados do usuário ao carregar
  useEffect(() => {
    fetch(`${API_URL}/usuario`)
      .then(res => res.json())
      .then(data => {
        console.log('Dados recebidos do backend:', data);
        setPerfil(data);
        setForm(data);
        setImagemPreview(data.imagem || '');
        setCarregando(false);
      });
  }, []);

  const handleChange = e => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleImagemChange = e => {
    const file = e.target.files[0];
    if (file) {
      setImagemArquivo(file);
      setImagemPreview(URL.createObjectURL(file));
    }
  };

  const handleSubmit = async e => {
    e.preventDefault();
    const formData = new FormData();
    if (imagemArquivo) {
      formData.append('imagem', imagemArquivo);
    }
    formData.append('nome', form.nome);
    formData.append('idade', form.idade);
    formData.append('rua', form.rua);
    formData.append('bairro', form.bairro);
    formData.append('estado', form.estado);
    formData.append('biografia', form.biografia);
    const resp = await fetch(`${API_URL}/usuario`, {
      method: 'POST',
      body: formData
    });
    const data = await resp.json();
    setPerfil(data);
    setForm(data);
    setImagemPreview(data.imagem || '');
    setImagemArquivo(null);
    setEditando(false);
  };

  if (carregando) {
    return <div className="flex items-center justify-center min-h-screen bg-gradient-to-br from-indigo-500 via-purple-400 to-pink-300 animate-gradient-x">Carregando...</div>;
  }

  return (
    <div className="min-h-screen flex items-center justify-center bg-gradient-to-br from-indigo-500 via-purple-400 to-pink-300 animate-gradient-x p-4">
      <div className="w-full max-w-md bg-white/30 backdrop-blur-lg rounded-3xl shadow-2xl p-8 border border-white/40 relative">
        <div className="absolute -top-8 left-1/2 -translate-x-1/2">
          <div className="bg-gradient-to-tr from-pink-400 via-indigo-400 to-purple-400 p-1 rounded-full animate-spin-slow">
            <img
              src={(!editando ? (perfil.imagem ? `${API_URL}${perfil.imagem}` : '') : imagemPreview) || 'https://ui-avatars.com/api/?name=User'}
              alt="Perfil"
              className="w-28 h-28 rounded-full object-cover border-4 border-white shadow-lg bg-white"
              style={{ animation: 'none' }}
            />
          </div>
        </div>
        <div className="mt-20">
          {!editando ? (
            <div className="text-center">
              <h2 className="text-3xl font-extrabold text-gray-900 mb-1 tracking-tight drop-shadow">{perfil.nome || <span className='text-gray-400'>Seu nome</span>}</h2>
              <p className="text-lg text-gray-500 mb-2">{perfil.idade ? perfil.idade + ' anos' : <span className='text-gray-300'>Idade</span>}</p>
              <p className="text-gray-600 mb-2">{perfil.rua || <span className='text-gray-300'>Rua</span>}, {perfil.bairro || <span className='text-gray-300'>Bairro</span>} - {perfil.estado || <span className='text-gray-300'>Estado</span>}</p>
              <p className="text-gray-700 mb-4 italic">{perfil.biografia || <span className='text-gray-300'>Sua biografia</span>}</p>
              <button onClick={() => setEditando(true)} className="px-6 py-2 bg-gradient-to-r from-indigo-500 to-pink-400 text-white rounded-full font-semibold shadow hover:scale-105 hover:from-pink-400 hover:to-indigo-500 transition-all duration-300">Editar Perfil</button>
            </div>
          ) : (
            <form onSubmit={handleSubmit} className="space-y-4">
              <div className="flex flex-col items-center">
                <label className="block text-sm font-medium text-gray-700">Foto de Perfil</label>
                <input type="file" accept="image/*" onChange={handleImagemChange} className="mt-1 block w-full text-sm text-gray-500 file:mr-4 file:py-2 file:px-4 file:rounded-full file:border-0 file:text-sm file:font-semibold file:bg-indigo-50 file:text-indigo-700 hover:file:bg-indigo-100" />
                {imagemPreview && (
                  <img src={imagemPreview} alt="Prévia" className="w-20 h-20 rounded-full mt-2 mx-auto object-cover border-2 border-indigo-400 shadow" />
                )}
              </div>
              <div>
                <label className="block text-left text-sm font-medium text-gray-700">Nome Completo</label>
                <input type="text" name="nome" value={form.nome} onChange={handleChange} className="mt-1 block w-full border-none rounded-xl px-3 py-2 bg-white/70 focus:ring-2 focus:ring-indigo-400 focus:outline-none shadow" />
              </div>
              <div className="flex gap-2">
                <div className="flex-1">
                  <label className="block text-left text-sm font-medium text-gray-700">Idade</label>
                  <input type="number" name="idade" value={form.idade} onChange={handleChange} className="mt-1 block w-full border-none rounded-xl px-3 py-2 bg-white/70 focus:ring-2 focus:ring-indigo-400 focus:outline-none shadow" />
                </div>
                <div className="flex-1">
                  <label className="block text-left text-sm font-medium text-gray-700">Estado</label>
                  <input type="text" name="estado" value={form.estado} onChange={handleChange} className="mt-1 block w-full border-none rounded-xl px-3 py-2 bg-white/70 focus:ring-2 focus:ring-indigo-400 focus:outline-none shadow" />
                </div>
              </div>
              <div className="flex gap-2">
                <div className="flex-1">
                  <label className="block text-left text-sm font-medium text-gray-700">Rua</label>
                  <input type="text" name="rua" value={form.rua} onChange={handleChange} className="mt-1 block w-full border-none rounded-xl px-3 py-2 bg-white/70 focus:ring-2 focus:ring-indigo-400 focus:outline-none shadow" />
                </div>
                <div className="flex-1">
                  <label className="block text-left text-sm font-medium text-gray-700">Bairro</label>
                  <input type="text" name="bairro" value={form.bairro} onChange={handleChange} className="mt-1 block w-full border-none rounded-xl px-3 py-2 bg-white/70 focus:ring-2 focus:ring-indigo-400 focus:outline-none shadow" />
                </div>
              </div>
              <div>
                <label className="block text-left text-sm font-medium text-gray-700">Biografia</label>
                <textarea name="biografia" value={form.biografia} onChange={handleChange} className="mt-1 block w-full border-none rounded-xl px-3 py-2 bg-white/70 focus:ring-2 focus:ring-indigo-400 focus:outline-none shadow resize-none" />
              </div>
              <div className="flex gap-2 mt-4">
                <button type="submit" className="flex-1 px-4 py-2 bg-gradient-to-r from-green-500 to-green-400 text-white rounded-full font-semibold shadow hover:scale-105 hover:from-green-400 hover:to-green-600 transition-all duration-300">Salvar</button>
                <button type="button" onClick={() => setEditando(false)} className="flex-1 px-4 py-2 bg-gray-200 text-gray-700 rounded-full font-semibold shadow hover:bg-gray-300 transition-all duration-300">Cancelar</button>
              </div>
            </form>
          )}
        </div>
      </div>
      <style>{`
        @keyframes gradient-x {
          0%, 100% { background-position: 0% 50%; }
          50% { background-position: 100% 50%; }
        }
        .animate-gradient-x {
          background-size: 200% 200%;
          animation: gradient-x 8s ease-in-out infinite;
        }
        .animate-spin-slow {
          animation: spin 6s linear infinite;
        }
      `}</style>
    </div>
  );
}

export default App;
